CREATE PROCEDURE [GetLocalidades]
AS
BEGIN
    select tl.Id,tl.Nombre,tl.Activo,tp.Nombre
    from tlocalidades tl 
    inner join 
    tprovincias tp
    on tl.PROVINCIA_ID = tp.Id
END
